import React,{useState} from 'react';
import './navbar.css'
import logo from '../../images/logo.png'
import {Link, NavLink} from "react-router-dom";
const Navbar = () => {

    const [click, setClick] = useState(true);

    const handleClick = () => setClick(!click);
    const closeMobileMenu = () => setClick(false);

    const [sctoled, setScroled] = useState(false);

    window.addEventListener('scroll', () => {
        const scrollPos = window.scrollY;
        if (scrollPos > 10) {
            setScroled(true)
        } else {
            setScroled(false)
        }
    });

    return (
        <>
            <nav id="header_area" className="navbar navbar-expand-md fixed-top  px-2 py-0 ">
                <div className="container">
                    <a href="index.html" className="navbar-brand"  onClick={closeMobileMenu}>
                        <img src={logo} alt="" className="img-fluid"/>
                    </a>
                    <button onClick={handleClick} className="navbar-toggler" type="button" data-toggle="collapse" data-target="#nav-menu"
                            aria-controls="nav-menu" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    {/*className="collapse navbar-collapse"*/}
                    <div  className={click ? 'collapse navbar-collapse' : 'navbar-collapse'} id="nav-menu">
                        <ul id="nav" className="navbar-nav ml-md-auto">
                            <li className="nav-item">
                                <a className="nav-link active" href="#" onClick={closeMobileMenu}>Home</a>
                            </li>

                            <li className="nav-item">
                                <a className="nav-link" href="#" onClick={closeMobileMenu}>business_details</a>
                            </li>

                            <li className="nav-item">
                                <a className="nav-link" href="#team" onClick={closeMobileMenu}>Team</a>
                            </li>

                            <li className="nav-item">
                                <a className="nav-link" href="#" onClick={closeMobileMenu}>Testimonial</a>
                            </li>

                            <li className="nav-item">
                                <a className="nav-link" href="#" onClick={closeMobileMenu}>Pricing</a>
                            </li>

                            <li className="nav-item">
                                <a className="nav-link" href="#" onClick={closeMobileMenu}>Contact</a>
                            </li>
                        </ul>

                    </div>
                </div>

            </nav>
        </>
    );
};

export default Navbar;
